import Video from './demo_vids/smoking.mp4';
import Poster from './demo_vids/smoking.png';
import Img from './images/smoking.png';
export const smoking = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Smoking Detection',
    description:
      'In hospitals, many actions are prohibited e.g., Smoking, Eating outside the cafeteria etc. Our model would detect such actions and generate an alert accordingly.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
